import Minipr from './Minipr';
import Time from './Time';
import Netflix from './Netflix';

import Cals,{mul,Div,Sub} from './Calc';


function App() {
  return (
    <>
  <Minipr />
  <Time />
  <Netflix />
  <ul>
    <li>sum of two num is {Cals(1,2)}</li>
    <li>substraction of two num is {Sub(2,3)}</li>
    <li>Division of two num is {Div(2,3)}</li>
    <li>Multiplication of two num is {mul(2,3)}</li>
  </ul>
</>
  );
}

export default App;
